import React from 'react';
import '../styles/Footer.css';

function Footer() {
  return (
    <div className="footer">
      <h3 className="footer_header">
        Get In Touch
      </h3>
      <div className="footer_social">
        <ul>
          <li></li>
        </ul>
      </div>
    </div>
  )
}

export default Footer;
